		var sound;
		var isStarting = false;
		function playMusic(){
			console.log("play")
			if(!isStarting){
				sound = createjs.Sound.play("music")
				isStarting = true;
			}
			else if(sound.paused){
				sound.paused = false;
			}
		}
		function pauseMusic(){
			console.log("pause")	
			if(!isStarting) return;
			if(!sound.paused){
				sound.paused = true;
			}
		}
